An ongoing superhero series from Mark Waid! IRREDEEMABLE dares to ask the question: what if the worlds greatest hero decided to become the worlds greatest villain? A-twilight of the superheroes-style story that examines super-villains from the writer of KINGDOM COME and EMPIRE! 
